import React from 'react';
import Card from '../../Card/Card';
import Navlink from 'react-router-dom';

function Mainmenu() {
  return (
    <div>
      <Card
        id='main_menu__Section'
        height='60px'
        background='red'
        border='1px solid red'
      >
        <Navlink>
          <a href='#'>Home</a>
        </Navlink>
      </Card>
    </div>
  );
}

export default Mainmenu;
